/*! jQuery Blogger Item Navigation 1.0 | http://modification-blog.blogspot.com */
var JudNav={};function ambilJudNav(json){for(var i=0;i<json.feed.entry.length;i++){var judul=json.feed.entry[i];var data="";for(var k=0;k<judul.link.length;k++){if(judul.link[k].rel=='alternate'){data=judul.link[k].href;break}}if(data!="")JudNav[data]=judul.title.$t}}document.write('<script type="text/javascript" src="http://'+window.location.hostname+'/feeds/posts/summary?redirect=false&max-results=500&alt=json-in-script&callback=ambilJudNav"></'+'script>');function JudulURL(anchor){var linkurl=anchor.match(/\/([^\/_]+)(_.*)?\.html/);if(linkurl){linkurl=linkurl[1].replace(/-/g," ");linkurl=linkurl[0].toUpperCase()+linkurl.slice(1);if(linkurl.length>28)linkurl=linkurl.replace(/ [^ ]+$/,"...")}return linkurl}$(window).load(function(){window.setTimeout(function(){var anchor=$("a.blog-pager-newer-link").attr("href");if(anchor){var judul=JudNav[anchor];if(!judul)judul=JudulURL(anchor);if(judul)$("a.blog-pager-newer-link").html(judul)}anchor=$("a.blog-pager-older-link").attr("href");if(anchor){var judul=JudNav[anchor];if(!judul)judul=JudulURL(anchor);if(judul)$("a.blog-pager-older-link").html(judul)}},500)});